import React from "react";

function AddNotes() {
  return (
    <div className="container">
      <div class="form-group m-3">
        <label for="exampleFormControlTextarea2">Add Notes</label>
        <textarea
          class="form-control rounded-0"
          id="exampleFormControlTextarea2"
          rows="3" w-20
        ></textarea>
        <button className=" btn-success rounded m-2 w-40">Add Note</button>
      </div>
    </div>
  );
}

export default AddNotes;
